import React from 'react'

function SummaryYouOwnContent(props){
    return(
        <div className="summary-you-own">
            <img class="img-size" src={props.url} />
            <div className="sumary-you-own-inside">
                <p>{props.name}</p>
                <p>owes you {props.amount}</p>
            </div>
        </div>
    )
}


export default SummaryYouOwnContent
